window.bookSummaryJSON = "<p>The King has fallen! </p> <p>While Stavros moves to take over Lars’s throne, the war for the entire kingdom begins. However, this is no ordinary war against Seelie or Unseelie. The real enemy is the most powerful object in the world: The Stone of Fail.</p> <p>Lars isn’t the only one the stone wants. Zoey Daniels is next on its list. And the stone will do whatever it takes to finally get the girl. </p> <p>With a battle on all sides and lives of those they love threatened, fae, humans, Druids, pixies, and a certain sprite-monkey will have to come together to save the true King, along with the world, from destruction. </p> <p>Out of ashes, true heroes <i>Rise from the Embers</i>. </p> <p>Don’t miss the final installment of the Dark/Light/Collector series, where your favorite characters unite to try and protect those they love, and the earth, from the ultimate opponent.</p> <p>Ember, Zoey, Kennedy, and Fionna lead the fight, but be prepared...not everyone will make it out alive.</p>"; 
